import React, { useState } from "react";

function FilterAddmember({ data }) {
  const [input, setinput] = useState("");

  const Handelinput = (e) => {
    setinput(e.target.value);
  };
  return (
    <div>
      <input type="search" value={input} onChange={Handelinput} />
      {console.log(data)}
    </div>
  );
}

export default FilterAddmember;
